import React, { useState } from "react";

import TextField from "@mui/material/TextField";
import { Navbar } from "react-bootstrap";
import Footer from "../../components/Footer/Footer";
import InputLabel from "@mui/material/InputLabel";
import MenuItem from "@mui/material/MenuItem";
import FormControl from "@mui/material/FormControl";
import Select, { SelectChangeEvent } from "@mui/material/Select";
import Button from "@material-ui/core/Button";
import ButtonGroup from "@material-ui/core/ButtonGroup";

import * as S from "./Home.styles";

function Home() {
  const [pageCount, setPageCount] = React.useState("2");

  const handleChange = (event: SelectChangeEvent) => {
    setPageCount(event.target.value);
  };

  return (
    <S.Wrapper>
      <S.TextLoginWrapper>
        <S.TextWrapper>
          <S.Title>Biz isi biliyoruz</S.Title>
          <S.SubTitle>
            Ananin Ami Ananin AmiAnanin AmiAnanin AmiAnanin AmiAnanin
          </S.SubTitle>

          <S.Title>Biz isi biliyoruz</S.Title>
          <S.SubTitle>
            Ananin Ami Ananin AmiAnanin AmiAnanin AmiAnanin AmiAnanin
          </S.SubTitle>
        </S.TextWrapper>
        <S.LoginWrapper>
          <TextField
            fullWidth
            error
            id="outlined-error"
            label="Error"
            defaultValue="Hello World"
          />
          <S.PagesWrapper>
            <FormControl sx={{ marginTop: 2 }}>
              <InputLabel>Page Count</InputLabel>
              <Select
                value={pageCount}
                label="Page Count"
                onChange={handleChange}
                fullWidth
              >
                <MenuItem value={1}>1</MenuItem>
                <MenuItem value={2}>2</MenuItem>
                <MenuItem value={3}>3</MenuItem>
              </Select>
            </FormControl>

            <ButtonGroup size="small" aria-label="small outlined button group">
              <Button
                disabled={counter >= product["countInStock"]}
                onClick={() => {
                  setCounter(counter + 1);
                }}
              >
                +
              </Button>

              {<Button disabled>{counter}</Button>}

              {
                <Button
                  disabled={counter <= 0}
                  onClick={() => {
                    setCounter(counter - 1);
                  }}
                >
                  -
                </Button>
              }
            </ButtonGroup>
          </S.PagesWrapper>
        </S.LoginWrapper>
      </S.TextLoginWrapper>
    </S.Wrapper>
  );
}

export default Home;
